    MOD = 10 ** 9 - 7
    dp = [[[[0 for _ in range(2)] for _ in range(2)] for _ in range(2)] for _ in range(61)]
    dp[60][0][0][0] = 1
    for n in range(60)[::-1]:
        lb = L >> n & 1
        rb = R >> n & 1
        for x in range(2):
            for y in range(2):
                for i in range(2):
                    for j in range(2):
                        for k in range(2):
                            ni = i
                            nj = j
                            nk = k
                            if x > y:
                                continue
                            if k == 0 and x != y:
                                continue
                            if x & y:
                                nk = 1
                            if i == 0 and x < lb:
                                continue
                            if x > lb:
                                ni = 1
                            if j == 0 and y > rb:
                                continue
                            if y < rb:
                                nj = 1
                            dp[n][ni][nj][nk] += dp[n + 1][i][j][k]
                            dp[n][ni][nj][nk] %= MOD
    result = (dp[0][1][1][1] + dp[0][0][1][1] + dp[0][1][0][1] + dp[0][0][0][1]) % MOD
    return result

